import React, { Component } from 'react'

export default class Button extends Component {
  render() {
    return (
      <button  type='button' onClick={()=>this.props.SetTime({A:5})}> {this.props.time}</button>
    )
  }

  choseTime(){
    this.props.SetTime({A:5})
    // console.log(123)
  }
}
